import React from 'react'
import { StyleSheet } from 'react-native'
import Center from './Center';

const StyleCentre = StyleSheet.create({
    
    conteiner:{
        display:'flex',
        flexDirection:'row',
        alignItems:"center",
        justifyContent:"center"
    },
    
    imgStyle :{
        height:100,
        width:100,
        borderRadius:10000000
    }
});

export default StyleCentre;
